import React from 'react';
import { FormControl, FormHelperText, InputLabel } from '@material-ui/core';

const Login = () => {
  return (
    <div>
      <FormControl>
        <InputLabel htmlFor="user-name">Username</InputLabel>
        <Input id="user-name" aria-describedby="username-helper-text" />
        <FormHelperText id="username-helper-text">Username or email</FormHelperText>
      </FormControl>
    </div>
  );
};

export default Login;
